window.bookSummaryJSON = "<p><b>My angel ex fell first and now we’re both falling apart. Bring snacks.</b></p> <p>I had it all figured out. A quiet life, my bookshop, and three cats who may or may not have magical tendencies. Love? That was a closed chapter. Until Caleb waltzed back in after seven years, turning my world upside down with a wink and a smile.</p> <p>Caleb isn’t just any ex, he’s a cupid. But now he’s a fallen angel on a mission, to get back the wings he lost for breaking celestial rules the first time around. <i>With me.</i></p> <p><b>I can’t have him, and yet he’s here</b>… posing as my date for my great-grandmother’s 100th birthday party, stirring up everything I swore I’d left behind. But when things go from fake to real between us in an unexpected moment of passion, everything changes.</p> <p>A second chance with Caleb risks more than just our hearts—it puts our very souls on the line. Heaven already took his wings, <b>now it might take him from me forever.</b></p> <p><b>If you love:</b></p> <p>• Fated Mates</p> <p>• Fake Dating my Angel Ex</p> <p>• Second Chance</p> <p>• Fallen Angels</p> <p>• He Falls First</p> <p>• Bookish, Fiercely Independent Heroine</p> <p>• Magical Cats and a Meddling Great-Grandmother</p> <p>This is the book for you!</p> <p>When Cupid Falls First is a standalone open-door, light-hearted romance with an HEA. Magic abounds, with a touch of humor. Welcome to Seattle.</p> <p><i>Previously titled When the Angel Falls First.</i></p>"; 
